$(document).on('turbolinks:load', function(){
  eventListeners();
});

function eventListeners(){
  upLike();
  downLike();
  expand();
}

// upLike a message
function upLike(){
 $('.uplike').on('submit', function(e){
  console.log("prevented uplike")
   e.preventDefault();
   var value, postUrl, data;
   value = 1;
   postUrl = $(this).attr('action');
   data = $(this).serialize();
   $.ajax({
     url: postUrl,
     method: 'PUT',
     data: data
   }).done(function(data) {
     $('.uplike').empty();
     $('.uplike').prepend(data);
   });
 })
};

// downLike a message
function downLike(){
 $('.downlike').on('submit', function(e){
   console.log("prevented downlike")
   e.preventDefault();
   $(this).siblings('.del').toggle();
   var tags, postUrl, data;
   tags = $(this);
   postUrl = $(this).attr('action');
   data = $(this).children(':first').serialize();
   $.ajax({
     url: postUrl,
     method: 'PUT',
     data: data
   }).done(function(data) {
     tags.toggle();
     $('.tag-value').empty();
     $('.tag-value').prepend(data);
   });
 })
};

function expand(){
  $('.expand').autoGrow();
};
